    accessKeyId: 'ASIA6HCXC5ABSN4GFDMY',
    secretAccessKey: '/csTc6BegqNb/arlPd34fuA828qmE98c0SOZMlPE',
}

class Home extends Component {
    constructor(){
        super();
    }

    upload(e){
        console.log(e.target.files);
        ReactS3.upload( e.target.files[0] , )
    }

    render(){
        return (
            <div>
                <h3>
                    aws test
                </h3>
                <input type="file" onChange={this.upload}/>
            </div>
        );
    }
}

export default Home;
